import React from 'react'
import './createNewProject.css'

const CPTPage = (props) => {
  return (
    <div className='d-flex'>
        <div className='create-project-inputs-style'>
            {props.inputs.map((eachInputType) => 
            <div>
                {eachInputType === "industry" && 
                <div>industry</div>
                }
                 {eachInputType === "description" && 
                <input 
                type='text'

                />
                }
                 {eachInputType === "name" && 
                <div>name</div>
                }
                 {eachInputType === "start-date" && 
                <div>start-date</div>
                }
                 {eachInputType === "projection-period" && 
                <div>projection-period</div>
                }
                 {eachInputType === "currency" && 
                <div>currency</div>
                }
                 {eachInputType === "tax-rate" && 
                <div>tax-rate</div>
                }
                 {eachInputType === "discount-rate" && 
                <div>discount-rate</div>
                }
                 {eachInputType === "sale-trend" && 
                <div>sale-trend</div>
                }
                 {eachInputType === "picture" && 
                <div>picture</div>
                }
            </div>)}
        </div>
        <div style={{width: "2px", height: "700px", backgroundColor: "#12aafc"}}></div>
        <div className='create-project-descriptions-style'>
            {props.description}
        </div>
    </div>
  )
}

export default CPTPage
